import React from 'react'

const Tab = ({ mapping , search}) => {
    return (
        <div>
            <table className='table'>
                <tbody>
                    <th>

                        <td>Name</td>
                        <td>Email</td>
                    </th>


                   {
                    mapping.filter((item) =>
                   item.name.toLowerCase().includes(search) )
                    .map(tab =>{
                        return   <tr key={tab.id} >
                        <td> {tab.name} </td>
                        <td> {tab.email} </td>
                    </tr>
                    })
                   }



                </tbody>
            </table>
        </div>
    )
}

export default Tab
